import "./App.css";
import { Route } from "react-router-dom";
import HomePage from "./pages/homepage/homepage.compnent";
import "./pages/homepage.style.scss";

const HatsPage = () => (
  <div>
    <h1>hats page</h1>
  </div>
);
function App() {
  return (
    <div>
      <Route exact path="/" component={HatsPage} />
      <Route exact path="/hats" component={HatsPage} />
    </div>
  );
}

export default App;
